(window.webpackJsonp=window.webpackJsonp||[]).push([[18],{xz0F:function(e){e.exports=[{id:1,type:"  brightbox_cloudip",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Optional)</strong> a label to assign to the CloudIP\n",elementType:"li",listDepth:1},{name:"reverse_dns",description:"<strong>(Optional)</strong> The reverse DNS entry for the CloudIP\n",elementType:"li",listDepth:1},{name:"target",description:"<strong>(Optional)</strong> The CloudIP mapping target. This is the interface id from a server, or the id of a load balancer, server group or cloud sql resource.\n",elementType:"li",listDepth:1},{name:"port_translator",description:"<strong>(Optional)</strong> An array of port translator blocks. The Port Translator block is descibed below\n",elementType:"li",listDepth:1},{name:"",description:"<p>Note that the default group for each account cannot be used as the target for a cloud ip.</p>",elementType:"p"},{name:"",description:"<p>Port Translator (<code>port_translator</code>) supports the following:\n* <code>incoming</code> - (Required) The Port number traffic is coming in on the network\n* <code>outgoing</code> - (Required) The Port number traffic is received at the mapped device\n* <code>protocol</code> - (Required) The protocol of the port translator. Either <code>tcp</code> or <code>udp</code></p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/cloudip.html",docType:""},{id:2,type:"  brightbox_orbit_container",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> A label assigned to the Orbit container\n",elementType:"li",listDepth:1},{name:"metadata",description:"<strong>(Optional)</strong> A dictionary of metadata key/value items. The key must be in lower case with no underscores or spaces\n",elementType:"li",listDepth:1},{name:"container_read",description:" <strong>(Optional)</strong> A set of accounts and referrals that are allowed to read the Orbit container\n",elementType:"li",listDepth:1},{name:"container_write",description:" <strong>(Optional)</strong> A set of accounts and referrals that are allowed to write to the Orbit container\n",elementType:"li",listDepth:1},{name:"container_sync_key",description:" <strong>(Optional)</strong> Sets the secret key for Orbit container synchronization. If this is cleared synchronisation stops\n",elementType:"li",listDepth:1},{name:"container_sync_to",description:" <strong>(Optional)</strong> Sets the destination for Orbit container synchronization. Used with <code>container_sync_key</code>\n",elementType:"li",listDepth:1},{name:"versions_location",description:" <strong>(Optional)</strong> The Orbit container to hold previous versions of this Orbit container's contents, which are automatically restored if an item is deleted. Cannot be used at the same time as <code>history_location</code>\n",elementType:"li",listDepth:1},{name:"history_location",description:" <strong>(Optional)</strong> The Orbit container to hold previous versions of this Orbit container's contents, where delete copies the item to history from this container. Cannot be used at the same time as <code>versions_location</code>\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/orbit_container.html",docType:""},{id:3,type:"  brightbox_database_server",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"allow_access",description:" <strong>(Required)</strong> - A list of server group ids, server ids or IPv4 address references the database server should be accessible from. There must be at least one entry in the list\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> A label assigned to the Database Server\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> A further description of the Database Server\n",elementType:"li",listDepth:1},{name:"maintenance_weekday",description:"<strong>(Optional)</strong> Numerical index of weekday (0 is Sunday, 1 is Monday...) to set when automatic updates may be performed. Default is 0 (Sunday). \n",elementType:"li",listDepth:1},{name:"maintenance_hour",description:"<strong>(Optional)</strong> Number representing 24hr time start of maintenance window hour for x:00-x:59 (0-23). Default is 6\n",elementType:"li",listDepth:1},{name:"snapshots_schedule",description:"<strong>(Optional)</strong> A crontab pattern to determine approximately when scheduled snapshots will run (must be at least hourly)\n",elementType:"li",listDepth:1},{name:"database_engine",description:"<strong>(Optional)</strong> Database engine to request. Default is mysql.\n",elementType:"li",listDepth:1},{name:"database_version",description:"<strong>(Optional)</strong> Database version to request. Default is 8.0.\n",elementType:"li",listDepth:1},{name:"database_type",description:"<strong>(Optional)</strong> ID of the Database Type required.\n",elementType:"li",listDepth:1},{name:"snapshot",description:" <strong>(Optional)</strong> - Database snapshot id to build from\n",elementType:"li",listDepth:1},{name:"zone",description:"<strong>(Optional)</strong> The handle of the zone required (<code>gb1-a</code>, <code>gb1-b</code>)\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/database_server.html",docType:""},{id:4,type:"  brightbox_firewall_policy",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"server_group",description:"<strong>(Optional)</strong> The ID of the Server Group the policy will be applied to\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> A label to assign to the Firewall Policy\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> A further description of the Firewall Policy\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/firewall_policy.html",docType:""},{id:5,type:"  brightbox_firewall_rule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"firewall_policy",description:"<strong>(Required)</strong> The ID of the firewall policy this rule belongs to\n",elementType:"li",listDepth:1},{name:"protocol",description:"<strong>(Optional)</strong> Protocol Number or one of <code>tcp</code>, <code>udp</code>, <code>icmp</code>\n",elementType:"li",listDepth:1},{name:"source",description:"<strong>(Optional)</strong> Subnet, ServerGroup or ServerID. <code>any</code>,<code>10.1.1.23/32</code> or <code>srv-4ktk4</code>\n",elementType:"li",listDepth:1},{name:"source_port",description:"<strong>(Optional)</strong> single port, multiple ports or range separated by <code>-</code> or <code>:</code>; upto 255 characters. Example",elementType:"li",listDepth:1},{name:"destination",description:"<strong>(Optional)</strong> Subnet, ServerGroup or ServerID. <code>any</code>,<code>10.1.1.23/32</code> or <code>srv-4ktk4</code>\n",elementType:"li",listDepth:1},{name:"destination_port",description:"<strong>(Optional)</strong> single port, multiple ports or range separated by <code>-</code> or <code>:</code>; upto 255 characters. Example",elementType:"li",listDepth:1},{name:"icmp_type_name",description:"<strong>(Optional)</strong> ICMP type name. <code>echo-request</code>, <code>echo-reply</code>. Only allowed if protocol is <code>icmp</code>.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> A further description of the Firewall Rule\n",elementType:"li",listDepth:1},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong> Only one of <code>source</code> or <code>destination</code> can be specified</p>\n</div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/firewall_rule.html",docType:""},{id:6,type:"  brightbox_load_balancer",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Optional)</strong> A label assigned to the Load Balancer\n",elementType:"li",listDepth:1},{name:"policy",description:"<strong>(Optional)</strong> Method of load balancing to use, either <code>least-connections</code> or <code>round-robin</code>\n",elementType:"li",listDepth:1},{name:"certificate_pem",description:"<strong>(Optional)</strong> A X509 SSL certificate in PEM format. Must be included along with <code>certificate_key</code>. If intermediate certificates are required they should be concatenated after the main certificate\n",elementType:"li",listDepth:1},{name:"certificate_private_key",description:"<strong>(Optional)</strong> The RSA private key used to sign the certificate in PEM format. Must be included along with <code>certificate_pem</code>\n",elementType:"li",listDepth:1},{name:"sslv3",description:"<strong>(Optional)</strong> Allow SSL v3 to be used. Default is <code>false</code>\n",elementType:"li",listDepth:1},{name:"buffer_size",description:"<strong>(Optional)</strong> Buffer size in bytes\n",elementType:"li",listDepth:1},{name:"nodes",description:"<strong>(Optional)</strong> An array of Server IDs\n",elementType:"li",listDepth:1},{name:"listener",description:"<strong>(Required)</strong> An array of listener blocks. The Listener block is described below\n",elementType:"li",listDepth:1},{name:"healthcheck",description:"<strong>(Required)</strong> A healthcheck block. The Healthcheck block is described below\n",elementType:"li",listDepth:1},{name:"",description:"<p>Listener (<code>listener</code>) supports the following:\n* <code>protocol</code> - (Required) Protocol of the listener. One of <code>tcp</code>, <code>http</code>, <code>https</code>, <code>http+ws</code>, <code>https+wss</code>\n* <code>in</code> - (Required) Port to listen on\n* <code>out</code> - (Required) Port to pass through to\n* <code>timeout</code> - (Optional) Timeout of connection in milliseconds. Default is 50000</p>",elementType:"p"},{name:"",description:"<p>Health Check (<code>healthcheck</code>) supports the following:\n* <code>type</code> - (Required) Type of health check required: <code>tcp</code> or <code>http</code>\n* <code>port</code> - (Required) Port to connect to to check health\n* <code>request</code> - (Optional) Path used for HTTP check\n* <code>interval</code> - (Optional) Frequency of checks in milliseconds\n* <code>timeout</code> - (Optional) Timeout of health check in milliseconds\n* <code>threshold_up</code> - (Optional) Number of checks that must pass before connection is considered healthy\n* <code>threshold_down</code> - (Optional) Number of checks that must fail before connection is considered unhealthy</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/load_balancer.html",docType:""},{id:7,type:"  brightbox_server",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"image",description:"<strong>(Required)</strong> The Server image ID\n",elementType:"li",listDepth:1},{name:"server_groups",description:" <strong>(Required)</strong> - An array of server group ids the server\nshould be added to. At least one server group must be specified.\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> The Server name\n",elementType:"li",listDepth:1},{name:"type",description:"<strong>(Optional)</strong> The handle of the server type required (<code>1gb.ssd</code>, etc)\n",elementType:"li",listDepth:1},{name:"zone",description:"<strong>(Optional)</strong> The handle of the zone required (<code>gb1-a</code>, <code>gb1-b</code>)\n",elementType:"li",listDepth:1},{name:"user_data",description:" <strong>(Optional)</strong> - A string of the desired User Data for the Server.\n",elementType:"li",listDepth:1},{name:"user_data_base64",description:" <strong>(Optional)</strong> - Already encrypted User Data - for use\nwith the template provider.\n",elementType:"li",listDepth:1},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong> Only one of <code>user_data</code> or <code>user_data_base64</code> can be specified</p>\n</div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/server.html",docType:""},{id:8,type:"  brightbox_server_group",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Optional)</strong> A label assigned to the Server Group\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> A further description of the Server Group\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/brightbox/r/server_group.html",docType:""}]}}]);